  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Andes
  NWR, Lake Andes WMD, and Karl E. Mundt NWR outlines Refuge accomplishments during
  the 1982 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, forests,
  croplands, grasslands, grazing, haying, fire management, pest control, water rights,
  and WPA easements. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, fisheries resources, marking and bird banding, and disease
  control. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, hunting, trapping, wildlife observation, and
  law enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment replacement,
  communication systems, and energy conservation. Cooperative programs and items of
  interest are provided at the end. Newspaper articles are attached.\",\n\t\"owner_org\":
